function generator1Function(profile, fields) {
    if(profile == null){
		return 0;
	}else{
		return profile['count'];
	}
}

job-step-params.aggregation-field-or-function-CUSTOM:
function profileAggregation(profile, fields) {

	if(profile === null){
		profile = {};
		profile['count'] = 0;
	}

    profile['count'] = fields['newCount'];
    return profile;
}

